import './App.css';
import Post from './Components/Post';


function App() {

  const arr = [{name: 'fds',body: 'dfs'},{name:'fdsf',body:'fds'},{name: 'dasf',body: 'hte'}];

  return (

    <div className="App">
      <Post name = {arr[0].name} body = {arr[0].body}/>
      <Post name = {arr[1].name} body = {arr[1].body}/>
      <Post name = {arr[2].name} body = {arr[2].body}/>
    </div>
  );
}

export default App;
